	@Test
	public void test_compare_angle(){
		CompareResults compareResults = new CompareResults(client, testConfig);
		JsonObject object1 = new JsonObject();
		object1.addProperty("angle", 22.0);
		JsonObject object2 = new JsonObject();
		object2.addProperty("angle", 22.099);
		Boolean test1 = compareResults.compareObjectProperties(object1, object1, "angle");
		assertTrue(test1);
		Boolean test2 = compareResults.compareObjectProperties(object1, object2, "angle");
		assertTrue(test2);
		object2.addProperty("angle", 22.1);
		assertTrue(compareResults.compareObjectProperties(object1, object2, "angle"));
		object2.addProperty("angle", 22.2);
		assertFalse(compareResults.compareObjectProperties(object1, object2, "angle"));
	}
	
	@Test
	public void test_compare_magnitude(){
		CompareResults compareResults = new CompareResults(client, testConfig);
		JsonObject object1 = new JsonObject();
		object1.addProperty("magnitude", 7402.0);
		JsonObject object2 = new JsonObject();
		object2.addProperty("magnitude", 7402.00099);
		Boolean test1 = compareResults.compareObjectProperties(object1, object1, "magnitude");
		assertTrue(test1);
		Boolean test2 = compareResults.compareObjectProperties(object1, object2, "magnitude");
		assertTrue(test2);
		object2.addProperty("magnitude", 7402.001);
		assertTrue(compareResults.compareObjectProperties(object1, object2, "magnitude"));
		object2.addProperty("magnitude", 7402.002);
		assertFalse(compareResults.compareObjectProperties(object1, object2, "magnitude"));
	}

